INSERT INTO `about_book` VALUES (6,27,'[{\"desc\": \"The story begins with Dr Huxtable coming to seeSherlock Holmes, the great detective, at his house inBaker Street. Huxtable is the headmaster of the famousPriory School in Mackleton in the north of England.One of the boys in the school is Arthur, the son of theDuke of Holdernesse, a Government Minister.One night the boy has disappeared, and SherlockHolmes (and his friend Dr Watson) agree to returnto the school with Dr Huxtable and help to look forhim. Before reaching the school, Holmes and Watsondiscover some more important facts behind the case.The Duke is separated from his wife – she lives inFrance. One of the teachers, a German teacher calledHeidegger is also missing. And so is a bicycleWhen they arrive at the school the Duke, and hissecretary Mr Wilder, are waiting for them.Holmes assumes that wherever the boy went hemust have crossed the moor behind the school. Sothe next morning, Holmes and Watson walk acrossthe moor, looking for bicycle tracks. After several hourssearching they ﬁnd some tracks, but they are not fromthe right bicycle. Then, ﬁnally, they ﬁnd the right tracksand follow them, ﬁnding both the bicycle – and theGerman teacher. He has been attacked and killed.Holmes supposes that Heidegger was following theboy on his bicycle and was killed by the kidnapper.The two men then stop at the Green Man, an inn,and talk to the owner, Reuben Hayes, who says thathe knows nothing about the kidnapping, although hedid once work for the Duke.At the end, Holmes discovers the full story, withthe Duke’s help. James Wilder is not only the Duke’ssecretary – he is also his illegitimate son. He was veryjealous of young Arthur, who will get all the Duke’smoney when he dies. With Hayes’ help he kidnappedArthur and took him across the moor to the GreenMan. Hayes killed Heidegger, who was followingthem. James had not wanted anyone to get hurt, sohe had gone straight to the Duke and told him thewhole story.The Duke didn’t want the whole world to knowabout his problems, so he and Wilder arranged for Hayes to run away – but in fact the police arrested himat the railway station. However Holmes agrees not totell the police about James Wilder; instead the Dukearranges for him to go and live in Australia.At the end of the story, Holmes is happy to takethe twelve thousand pounds reward for ﬁnding theboy, and giving the Duke the name of the kidnapper– even though the Duke already knew the answers tothese questions\", \"title\": \"The story\"}, {\"desc\": \"Sir Arthur Conan Doyle wrote a large number ofstories about the detective Sherlock Holmes, most ofthem set in Victorian England. Although not all of thestories are about rich and powerful people, many ofthem are. The Duke, like many men of his time, wantsthe world to think that he is a good family man, whenin fact he has an illegitimate child and he is living apartfrom his wife. It is almost more important to him tokeep his reputation than it is to ﬁnd his son.\", \"title\": \"Background to the story\"}, {\"desc\": \"Here are some ways to help your students approach the story:\\n1. Give students the title of the book and show them the picture on the cover. Ask them to try and guess what kind of the story it is.\\n2. Give students a copy of the text on the back cover of the book, and of the story introduction on the ﬁrst page. When they have read the texts, ask them a few questions about the story, or use the Before Reading Activities in the back of each Bookworm.\\n3. Use the pre-reading activity in this worksheet.\\n4. If there is a recording of this title, play the ﬁrst few pages and stop at an interesting point.\", \"title\": \"Before Reading\"}]'),(7,31,'[{\"desc\": \"The story begins with Dr Huxtable coming to seeSherlock Holmes, the great detective, at his house inBaker Street. Huxtable is the headmaster of the famousPriory School in Mackleton in the north of England.One of the boys in the school is Arthur, the son of theDuke of Holdernesse, a Government Minister.One night the boy has disappeared, and SherlockHolmes (and his friend Dr Watson) agree to returnto the school with Dr Huxtable and help to look forhim. Before reaching the school, Holmes and Watsondiscover some more important facts behind the case.The Duke is separated from his wife – she lives inFrance. One of the teachers, a German teacher calledHeidegger is also missing. And so is a bicycleWhen they arrive at the school the Duke, and hissecretary Mr Wilder, are waiting for them.Holmes assumes that wherever the boy went hemust have crossed the moor behind the school. Sothe next morning, Holmes and Watson walk acrossthe moor, looking for bicycle tracks. After several hourssearching they ﬁnd some tracks, but they are not fromthe right bicycle. Then, ﬁnally, they ﬁnd the right tracksand follow them, ﬁnding both the bicycle – and theGerman teacher. He has been attacked and killed.Holmes supposes that Heidegger was following theboy on his bicycle and was killed by the kidnapper.The two men then stop at the Green Man, an inn,and talk to the owner, Reuben Hayes, who says thathe knows nothing about the kidnapping, although hedid once work for the Duke.At the end, Holmes discovers the full story, withthe Duke’s help. James Wilder is not only the Duke’ssecretary – he is also his illegitimate son. He was veryjealous of young Arthur, who will get all the Duke’smoney when he dies. With Hayes’ help he kidnappedArthur and took him across the moor to the GreenMan. Hayes killed Heidegger, who was followingthem. James had not wanted anyone to get hurt, sohe had gone straight to the Duke and told him thewhole story.The Duke didn’t want the whole world to knowabout his problems, so he and Wilder arranged for Hayes to run away – but in fact the police arrested himat the railway station. However Holmes agrees not totell the police about James Wilder; instead the Dukearranges for him to go and live in Australia.At the end of the story, Holmes is happy to takethe twelve thousand pounds reward for ﬁnding theboy, and giving the Duke the name of the kidnapper– even though the Duke already knew the answers tothese questions\", \"title\": \"The story\"}, {\"desc\": \"Sir Arthur Conan Doyle wrote a large number ofstories about the detective Sherlock Holmes, most ofthem set in Victorian England. Although not all of thestories are about rich and powerful people, many ofthem are. The Duke, like many men of his time, wantsthe world to think that he is a good family man, whenin fact he has an illegitimate child and he is living apartfrom his wife. It is almost more important to him tokeep his reputation than it is to ﬁnd his son.\", \"title\": \"Background to the story\"}, {\"desc\": \"Here are some ways to help your students approach the story:\\n1. Give students the title of the book and show them the picture on the cover. Ask them to try and guess what kind of the story it is.\\n2. Give students a copy of the text on the back cover of the book, and of the story introduction on the ﬁrst page. When they have read the texts, ask them a few questions about the story, or use the Before Reading Activities in the back of each Bookworm.\\n3. Use the pre-reading activity in this worksheet.\\n4. If there is a recording of this title, play the ﬁrst few pages and stop at an interesting point.\", \"title\": \"Before Reading\"}]');
