INSERT INTO `book` VALUES (27,'Sherlock Holmes and the Duke’s Son','Jennifer Bassett','2007-11-08',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665649/zzeoyces8eyo8ex7jyvq.webp','In this classic detective tale, Sherlock Holmes is on a new case, solving a mysterious and intriguing puzzle. Join the brilliant detective and his trusted companion, Dr. Watson, as they work to unravel the enigma surrounding the Duke’s son. A captivating journey into the world of deduction and logic awaits readers in this engaging story.',NULL),(28,'A Little Princess','Jennifer Bassett','1995-05-10',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665690/pnowkzdgynzjxustxgqy.webp','Experience the heartwarming journey of Sara Crewe, a young girl who, despite her hardships, maintains her inner strength and kindness. \"A Little Princess\" is a touching tale of resilience and the power of imagination, sure to enchant readers of all ages.',NULL),(29,'The Adventures of Tom Sawyer','Nick Bullard','2008-11-01',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665791/d5m9r9dkvt14rfuefdhl.webp','Join the mischievous and adventurous Tom Sawyer in Mark Twain\'s timeless classic. Follow Tom\'s escapades as he explores the banks of the Mississippi River, seeking treasure, and encountering unforgettable characters in a story that captures the essence of boyhood.',NULL),(30,'The Boy-King Tutankhamun','Walter McGregor','2016-05-05',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665969/jzwhchddhigb27h9s1ib.jpg','Delve into ancient Egypt and the remarkable discovery of the tomb of the boy-king Tutankhamun. This historical account brings to life the excitement and mysteries of archaeological exploration, making history come alive for readers.',NULL),(31,'The Year of Sharing','Harry Gilbert','2010-12-16',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1697119953/kpmxocvq3cbfwhp7sbja.jpg','Join the heartwarming journey of a young girl named Lucy, who embarks on a mission to spread kindness and goodwill in her community during \"The Year of Sharing.\" This inspiring tale emphasizes the power of giving and unity.',NULL),(32,'Stories from the Five Towns','Nick Bullard','2007-12-20',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698666136/qpzwzmubkstsipj4ivcr.jpg','Explore the lives and dramas of the people living in the fictional Five Towns in this collection of stories. Witness the ups and downs, hopes and dreams, and everyday struggles of individuals in a quintessential English setting.',NULL),(33,'The Prince and the Pauper','Alex Raynham','1996-11-16',72,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698666182/clg72lweuegplsoqxkob.webp','Travel back to Tudor England in Mark Twain\'s classic, \"The Prince and the Pauper.\" Follow the unforgettable journey of two boys who exchange their roles, leading to a series of adventures, lessons, and discoveries about identity and social class.',NULL),(34,'Huckleberry Finn','Diane Mowat','1994-09-01',64,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698666230/faq2s2oyifmfbcgihbku.webp','Venture down the Mississippi River with Huckleberry Finn in Mark Twain\'s timeless tale. Join Huckleberry and his friend Jim, a runaway slave, on an adventurous journey filled with freedom, friendship, and a profound commentary on society.',NULL),(35,'The Railway Children','John Escott','2007-12-27',80,'Teenagers',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698666465/lu7f5scraih8murijz7l.jpg','Follow the heartwarming journey of the Waterbury siblings as they navigate the challenges of their new life in the countryside and their efforts to help solve the mystery of the missing father in \"The Railway Children.\" This classic tale of family, adventure, and resilience captivates readers of all ages.',NULL),(36,'A Christmas Carol','Clare West','2009-05-01',80,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698670911/qwvgqcx5ygghyo4yko07.jpg','Join Ebenezer Scrooge on his transformative journey in Charles Dickens\' beloved holiday classic, \"A Christmas Carol.\" This story brings the spirit of Christmas to life as Scrooge encounters the ghosts of past, present, and future, leading to a profound change of heart.',NULL),(37,'The Secret Garden','Clare West','2008-02-08',80,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665604/pv6regucfnggcr84e8cv.jpg','Enter the enchanting world of \"The Secret Garden,\" where Mary Lennox, a young girl, discovers a hidden, neglected garden and the magic it holds. Witness her transformative journey of healing, friendship, and the power of nature.',NULL),(38,'Kidnapped','Clare West','2007-12-20',72,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1702052029/kkqbffdcsjpi9fvh2h6x.jpg','I ran to the side of the ship. \"Help, help! Murder!\" I screamed, and my uncle slowly turned to look at me. I did not see any more. Already strong hands were pulling me away. Then something hit my head; I saw a great flash of fire, and fell to the ground . .. And so begins David Balfour\'s adventures. He is kidnapped, taken to sea, and meets many dangers. He also meets a friend, Alan Breck. But Alan is in danger himself, on the run from the English army across the wild Highlands of Scotland . . .',NULL),(39,'The Merchant of Venice','Clare West','2016-01-15',112,'Tennager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698671124/w5bm4wc7mo39tz7fxmlf.png','Immerse yourself in William Shakespeare\'s iconic play, \"The Merchant of Venice.\" Explore themes of love, justice, and the complexities of human nature as you follow the entwined fates of Antonio, Shylock, and Portia in this timeless classic.',NULL),(40,'Little Dorrit','Rowena Akinyemi','2015-01-08',128,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698671277/byk6h4hzjw4k43rnra9t.png','Step into the intricate world of Charles Dickens in \"Little Dorrit.\" Follow the life of Amy Dorrit as she navigates the complexities of her family\'s debt, the Marshalsea debtor\'s prison, and the web of characters in Victorian London. This novel weaves a tapestry of love, sacrifice, and societal critique.',NULL),(41,'Ghost Stories','Rosemary Border','1989-04-27',112,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698671327/xvh6rye2c7mptk6ztfks.jpg','Prepare to be thrilled and chilled by a collection of eerie and spine-tingling \"Ghost Stories.\" These tales of the supernatural and the unexplained will captivate your imagination and send shivers down your spine, making for an unforgettable reading experience.',NULL),(42,'David Copperfield','Charles Dickens','2010-12-27',112,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698671460/ppqmbsv0tvqyq8xfse90.jpg','Join the young David Copperfield on his journey through life in Charles Dickens\' autobiographical masterpiece. Experience his trials, triumphs, and the colorful characters he encounters as he seeks to find his place in the world.',NULL),(43,'Oliver Twist','Richard Rogers','2007-12-27',128,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698671521/q27ldag6ycfpgnln5b13.jpg','Step into the world of Charles Dickens with \"Oliver Twist,\" the story of a young orphan who embarks on a journey through the gritty streets of 19th-century London. Follow Oliver\'s adventures, the colorful characters he encounters, and the themes of social injustice and redemption.',NULL),(44,'The Riddle of the Sands','Peter Hawkins','2008-01-24',112,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698671978/bolrkgoswh5vfs08tpn7.png','Delve into the world of espionage and mystery with \"The Riddle of the Sands.\" Join two friends on their sailing adventure along the coast of Germany as they uncover a web of secrets, espionage, and danger, creating a thrilling tale of suspense.',NULL),(45,'American Crime Stories','John Escott','2009-04-09',128,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698672127/riooao3d8ycu7pepeweh.jpg','Explore the dark and intriguing world of \"American Crime Stories,\" a collection of thrilling tales that delve into the minds of criminals and the pursuit of justice in the United States. These stories will keep you on the edge of your seat with their suspense and intrigue.',NULL),(46,'Jane Eyre','Clare West','2011-01-06',128,'Teenager',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698672333/cvp5l4y5ervl6rff0tnd.jpg',' Immerse yourself in Charlotte Brontë\'s classic novel, \"Jane Eyre.\" Follow the journey of the strong-willed and independent Jane as she faces adversity, love, and personal growth in a complex and captivating story of passion and self-discovery.',NULL),(47,'Mansour and the Donkey','Sue Arengo','2015-02-05',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665392/dqzfuaoy31pfkepzkkdr.jpg','Join Mansour on his humorous adventure with a stubborn donkey in \"Mansour and the Donkey.\" This entertaining story teaches valuable lessons about persistence and problem-solving with a touch of comedy.',NULL),(48,'Peach Boy','Sue Arengo','2006-05-04',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665294/xnsla5jtthhfc3sitn58.jpg','Experience the magical journey of Peach Boy, a young hero with a peach-shaped head, as he embarks on a quest to vanquish evil in this delightful and enchanting tale.',NULL),(49,'The Little Red Hen','Rachel Bladon','2010-07-06',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665179/gbsirlkbntrjt17uqknb.jpg','Dive into the world of teamwork and responsibility with \"The Little Red Hen.\" This classic fable illustrates the importance of cooperation and hard work as the Little Red Hen seeks help with her chores.',NULL),(50,'The Three Billy Goats','Sue Arengo','2009-06-30',16,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698665005/qgdm5hnieeg4ebn6oqxu.jpg','Travel to the land of trolls and bridges with \"The Three Billy Goats Gruff.\" Follow the adventures of three brave goats as they outsmart a fearsome troll in this timeless and engaging story.',NULL),(52,'Amrita and the Trees','Sue Arengo','2011-07-28',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698656739/tu2inwzyrqnxjvdrdboc.jpg','Join Amrita, a young girl with a special connection to nature, on a magical journey of discovery in \"Amrita and the Trees.\" This enchanting story celebrates the bond between humans and the environment, highlighting the importance of caring for our natural world.',NULL),(53,'Big Baby Finn','Sue Arengo','2012-01-19',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698674863/t2cg1o0kztrhkwaxygnl.jpg','Enter the imaginative world of \"Big Baby Finn\" as you follow the adventures of young Finn and his extraordinary experiences with his beloved baby brother, who isn\'t quite what he seems. This whimsical and heartwarming tale explores the joys and challenges of siblinghood.',NULL),(54,'King Arthur and the Sword','Rachel Bladon','2015-09-01',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698656893/m3tra8fkde7zavdq5ssv.jpg','Travel back to the days of knights and chivalry with the legendary tale of \"King Arthur and the Sword.\" Follow Arthur\'s journey to become the true king as he wields the sword Excalibur, uniting a kingdom and fulfilling his destiny.',NULL),(55,'Thumbelina','Sue Arengo','2012-06-07',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698657087/znfqdf9ms72i3t632bmr.jpg','Immerse yourself in the tiny world of \"Thumbelina,\" a girl no bigger than a thumb. Witness her remarkable adventures as she navigates a world filled with creatures both friendly and dangerous, teaching lessons of courage, kindness, and resilience.',NULL),(56,'Goldilocks and the Three Bears','Gerda Muller','2011-05-26',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698660034/iqsbhjyl4cdcvitxeink.jpg','Venture into the enchanting forest with Goldilocks as she stumbles upon the home of the Three Bears. Follow her charming adventure and discover the importance of respect and consideration for others in this classic tale.\n',NULL),(57,'Mulan','Rachel Bladon','2017-02-16',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698662601/sxq6lykyxfmcvxx3mkyw.png','Enter the world of bravery and honor with \"Mulan.\" Join the courageous Mulan as she disguises herself as a man to take her father\'s place in the army. This inspiring story showcases the power of determination, sacrifice, and inner strength.',NULL),(58,'The Heron & Hummingbird','Rachel Bladon','2013-04-07',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698662040/xmega50tc9r3gynqcuxm.jpg','Learn a valuable lesson in cooperation and friendship with \"The Heron and the Hummingbird.\" Follow the unlikely friendship between a tall and a tiny bird as they overcome their differences and work together to solve a problem.',NULL),(59,'The Little Mermaid','Sue Arengo','2012-11-19',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698662229/zth1gozhphqlnphsdnkt.jpg','Dive into the depths of the ocean and follow the mesmerizing journey of \"The Little Mermaid.\" Discover the sacrifices she makes to explore the human world, learning important lessons about love, sacrifice, and self-discovery along the way.',NULL),(60,'The Goose Girl','Sue Arengo','2012-02-01',24,'KIds',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698663418/tmpgvgppdvsu6zrrw4pv.jpg','Join the enchanting journey of \"The Goose Girl\" as a young princess must use her wit and bravery to reclaim her royal identity while tending to a flock of magical geese. This classic fairy tale highlights themes of courage, resourcefulness, and the enduring spirit of a true princess.',NULL),(61,'The Twelve Dancing Princesses','Sue Arengo','2011-09-19',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698662972/oggrbwtptdzaqzhywmwh.jpg','Step into a world of mystery and magic with \"The Twelve Dancing Princesses.\" Follow the adventures of twelve royal sisters who, night after night, embark on secret dancing escapades. Discover the hidden enchantment and a clever soldier\'s quest to uncover their secret.',NULL),(62,'Don Quixote: Adventures of a Spanish Knight','Rachel Bladon','2016-02-24',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698663139/rlbqppsxmad3ixaf9vyo.jpg','Immerse yourself in the epic tales of the legendary Spanish knight, Don Quixote. Follow his whimsical and heroic adventures as he sets out to revive chivalry, fight windmills, and uphold the ideals of honor, courage, and justice.',NULL),(63,'Sleeping Beauty','Sue Arengo','2011-05-26',24,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698663296/x1ksuxiejzlxldo7biiw.jpg','Enter a world of dreams and enchantment with the timeless story of \"Sleeping Beauty.\" Follow the spellbound princess and the brave prince who awakens her from a century-long slumber with the power of true love\'s kiss.',NULL),(64,'Pinocchio','Sue Arengo and Rachel Bladon','2009-07-30',32,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698663686/t0puzdfab5jqsk6ozgfg.jpg','Journey into the enchanting world of \"Pinocchio,\" the mischievous wooden puppet who longs to become a real boy. Follow his adventures and life lessons as he learns the value of truth, kindness, and the meaning of being human.',NULL),(65,'Snow White and the Seven Dwarfs','Rachel Bladon','2001-10-13',16,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698663900/a2a4yxgk9dtzngmxlr4k.webp','Enter the realm of fantasy and magic with the timeless tale of \"Snow White and the Seven Dwarfs.\" Follow the beautiful princess as she faces the jealousy of an evil queen and finds refuge with seven endearing dwarfs. This classic story celebrates the enduring themes of love, friendship, and courage.',NULL),(66,'The Beauty and the Beast','Sue Arengo','2012-05-24',32,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698664067/x96tv7lvmes1ccqtxlf4.jpg','Be captivated by the enchanting story of \"The Beauty and the Beast.\" Follow the journey of Belle, a young woman who discovers that true beauty lies within. Witness her love and kindness transform a beast into a prince in this tale of acceptance and love.',NULL),(67,'The Magic Brocade','Sue Arengo','2010-07-15',32,'Kids',NULL,'https://res.cloudinary.com/dtwkikmuy/image/upload/v1698664221/hyskqvzx2k06g4t8uywf.jpg','Step into a world of Chinese folklore with \"The Magic Brocade,\" a story of kindness and compassion. Follow the magical journey of a weaver\'s daughter as she learns the importance of helping others, leading to remarkable rewards.',NULL);
